if (process.env.TK_SIGN_ID && process.env.TK_SIGN_SIGN) {
    TK_SIGN = { id: process.env.TK_SIGN_ID, sign: process.env.TK_SIGN_SIGN }
}

if (!TK_SIGN) {
    console.log('联系@dpqd_boss获取TK_SIGN.')
    return
}

